var cutsceneData_tellAFriend = {
	id: `Tell A Friend`,
	effects: ``,
	frames: [
		`CAM~-2853.1458~-16.1207~-40563.2173~4.8905~-0.0000~0.8000|3BR~-3190.0733~22.1058~-40502.5692~100~0.0000|LGT~-3080.2247~-75.6046~-40675.3427|LGT~-2988.2323~-129.8257~-40612.5721|SPR~0.4195~0.8198~0.0289~data_sprites.Runner.sheet~0.0000~false~15~4|SPR~0.5860~0.9177~0.0453~data_sprites.Student.sheet~0.0000~false~3~4|BUB~0.4617~0.2865~0.0719~0.0458|BUB~0.2352~0.6552~0.2148~0.0813|BUB~0.6328~0.1365~0.2852~0.0313|BUB~0.7625~0.4635~0.2063~0.0781|LIN~0.4477~0.3125~0.3070~0.6021|TRI~0.3649~0.7052~0.3992~0.7573~0.0086|TRI~0.7211~0.5302~0.5961~0.8469~0.0094|LIN~0.7688~0.1583~0.7649~0.3990|TXT~0.4625~0.2719~0.1000~0.0500~Huh?~false|TXT~0.2344~0.6208~0.2094~0.0500~You brought a box? How's that work?~false|TXT~0.6508~0.1271~0.2766~0.0333~I know I'm glossing over some important~false|TXT~0.7625~0.4271~0.1922~0.0500~Never mind. Check out what I found!~false`, 
		`CAM~-2853.1458~-16.1207~-40563.2173~4.8905~0.0000~0.8000|3BR~-3190.0733~22.1058~-40502.5692~100~0.0000|LGT~-3012.8347~-74.7816~-40656.5141|LGT~-3013.6724~-126.3071~-40616.4060|SPR~0.4274~0.8594~0.0336~data_sprites.Runner.sheet~0.0000~false~0~2|SPR~0.5594~0.8469~0.0320~data_sprites.Student.sheet~0.0000~false~13~8|TXT~0.5008~0.0083~0.4965~0.0240~I'm not sure yet, 'cause I haven't had much time to study it. I was wandering through the box storage area and noticed this one box that had these rings floating next to it. And when I stood on it, I noticed it felt a bit less solid than usual. Well, not less *solid* per se, but more springy. Obviously these rings do something, but we're going to need *way* more than a day to figure out what. So far what I've found is - and keep in mind these are just my initial observations - the box goes where you push it, except that it prefers to move in the plane defined by the rings. In other words, you *can* move it up and down, but it takes lots of extra force. Same with turning it. Oh, and I also noticed that it won't go outside the tunnel. That must be why it never moved when we ran on it: we were pushing it outwards, and it was already at the edge. I think it's tied to the artifical gravity somehow. I assume you've noticed the way gravity changes suddenly at the edge of the tunnel? The rings probably react to the change in gravity and pull the box back in. Or maybe it's the *box* itself that does it... Actually, that makes a lot of sense now that I think about it. We already know there's some force keeping all the normal boxes and tiles in place. Except, hmm... Except for cracked tiles. They're a clear counterexample, so maybe I'm wrong here. On the other arm, this box isn't the odd one out, the cracked tiles are. Remind me to take time to study those too. If we figure out why cracked tiles can leave the tunnel, it should give a clue as to why nothing else does. Anyway, back to the main topic: how these rings work. Clearly they aren't the same as the first rings I found, but at this point I think it's safe to conclude that those ones are malfunctioning somehow. Another thing to come back to later. So I was thinking about that, and I recently spoke with the Gentleman about all these floating batteries. We only did one test before he ran off, and you should speak to him about that, because there's a lot more we could learn from him and his magnet. Or if you find any loose magnets, be sure to hold on to them. Sorry, I'm getting sidetracked again. The point is, I've been thinking about the way the batteries float down the middle of the tunnels, and now I'm thinking maybe this box is similar. The best part is, the box doesn't turn off the moment you touch it, so it should be much easier to experiment on. I think the first thing to try and find out is what it's attached to. Besides the rings, I mean. Later, maybe we can figure out how the rings stick to the box without actually touching it, but for now, we'll just accept that they do. You can stick your arm between the ring and the box, and there's nothing but air. Knowing this, we can assume it also explains how the box hangs in midair. Remember, the fewer assumptions an explanation makes, the more likely it is. But we *already* made the assumption that objects can be connected without actually touching. It's safer to reuse the old assumption, rather than making a new one, because you want to keep your assumption count as low as possible. Ugh, sorry, that was kind of a roundabout way of saying that. This is why I prefer to prepare my explanations beforehand... Ok, here's another way to think about it. If you push something, it *ought* to move. The only way for it to stay still is if something else is pushing - or pulling - in the opposite direction. Well, maybe not the *only* way. I've read sci-fi books that say gravity technically isn't a force, even though it can counteract forces. Oh, and these tunnels manipulate gravity somehow, so we can't rule it out, but I'm still going to start with the simpler hypotheses. My first guess is that the box anchored to the tunnel, and when I push on it, I'm pushing on the whole tunnel, not just the box. This is the safest guess because - again - we already know there's a mechanism. My second guess is that it pushes on the air. I haven't noticed any weird air currents yet, but I'm not certain what sort of air currents I'd expect, even assuming that guess was true. We'll need to do more tests before ruling it out. If neither of those hypotheses works out, then we start considering all that artificial gravity weirdness. Not sure how we'd test it, but we'll cross that storm when - if - we come to it.~true|BUB~0.2828~0.7344~0.1422~0.0448|BUB~0.4797~0.9458~0.3781~0.0406|LIN~0.2070~0.9281~0.2070~0.7625|TRI~0.3938~0.7542~0.4195~0.8000~0.0078|TXT~0.2844~0.7167~0.1492~0.0500~Interesting...~false|TXT~0.4906~0.9292~0.3477~0.0500~But let me rephrase my question.~false`, 
		`CAM~-2853.1458~-16.1207~-40563.2173~4.8905~0.0000~0.8000|3BR~-3190.0733~22.1058~-40502.5692~100~0.0000|LGT~-3012.8347~-100.5011~-40647.0064|LGT~-3003.3265~-129.2623~-40613.5146|SPR~0.5656~0.8688~0.0352~data_sprites.Student.sheet~6.2271~true~1~8|SPR~0.4500~0.8719~0.0375~data_sprites.Runner.sheet~0.0000~false~14~6|BUB~0.3742~0.3042~0.2523~0.0823|BUB~0.6844~0.6531~0.2352~0.0406|TRI~0.3383~0.3635~0.4336~0.8000~0.0094|TRI~0.5875~0.6865~0.5703~0.8000~0.0086|TXT~0.3750~0.2656~0.2383~0.0500~We need more of these. Where should I look?~false|TXT~0.6844~0.6385~0.2352~0.0500~Oh, right! Follow me.~false`, 
	]
}

